import React, { Component } from 'react';
import moment from 'moment';


export class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      month: moment(),
      selected: moment().startOf('day')
    };
}

previous = () => {
  const {
    month,
  } = this.state;

  this.setState({
    month: month.subtract(1, 'month'),
  });
}

next = () => {
  const {
    month,
  } = this.state;

  this.setState({
    month: month.add(1,'month'),
  });
}


  render() {
    return (
      <div>
        <h2>{this.state.today}</h2>
      </div>
    )
  }
}

export default Home
